import React, { useContext } from 'react';

const Home = () => {
  const authCtx = useContext();
  return (
    <div>
      HOME
      <button
        onClick={() => {
          authCtx.logout();
        }}
      >
        LOGOUT
      </button>
    </div>
  );
};

export default Home;
